const List = ({ items }) => {
    return (
        <ul className="flex">
            <article>
                <ul className = "bg-gray-100 mx-20 p-5 rounded-lg mt-10">
                    {items.map(({id, title}) => (
                        <>
                            <li key={id} className="text-black py-2 tracking-wider border">{title}</li>
                            <button><IoClose/></button>
                        </>
                    ))}
                </ul>
            </article>
        </ul>
    )
}

export default List
